import React from 'react';
import Search from "./SearchBar";
import List from "./List";

function Rank(props) {
    return (
      <div>
        <div className="Rankd-List">
          <h3>Ranked Motherfucker {props.list.title}</h3>
          <h3>Created By: {props.list.username}</h3>
          <h2>Description</h2>
          <h1>{props.list.text}</h1>
          <h1></h1>
        </div>

        <div className="add-movies">
          <Search searchValue={props.searchValue} setSearchValue={props.setSearchValue}/>
          <List items={props.movies} />
        </div>
      </div>
    )
}

export default Rank;
